/**
* Download LOB's associated with a NastyLobRow into files.
* @param NastyLobRow theRow - The row we want to process
* @param String filenameAClob Full file name for downloaded LOB. Passing in null means you don't want it downloaded.
* @param String filenameABlob Full file name for downloaded LOB. Passing in null means you don't want it downloaded.
* @param String filenameABfile Full file name for downloaded LOB. Passing in null means you don't want it downloaded.
* @return NastyLobRow The row with LOB pointers downloaded into files
* @throws CSException when something goes wrong while downloading.
**/
public NastyLobRow downloadNastyLobLobs(NastyLobRow theRow
                                       ,String filenameAClob
                                       ,String filenameABlob
                                       ,String filenameABfile
                                       ) throws CSException
{
try
  {
  // download CLOB associated with column A_CLOB
  if (filenameAClob != null && theRow.lobRowAClob != null)
    {
    java.io.File tempFile = new java.io.File (filenameAClob);
    
    theRow.filenameRowAClob = tempFile.getAbsolutePath();
    theRow.rowAClob = tempFile;
    startStatsTimer();
    theRow.rowAClob = objectLoader.unloadBinaryStream(tempFile, theRow.lobRowAClob.binaryStreamValue(), "CLOB");
    incRetrieveTime();
    }
  }
catch (Exception e)
  {
  throw new CSException("Error While downloading LOB Column A_CLOB: " + e.getMessage());
  }
 
try
  {
  // download BLOB associated with column A_BLOB
  if (filenameABlob != null && theRow.lobRowABlob != null)
    {
    java.io.File tempFile = new java.io.File (filenameABlob);
    
    theRow.filenameRowABlob = tempFile.getAbsolutePath();
    theRow.rowABlob = tempFile;
    startStatsTimer();
    theRow.rowABlob = objectLoader.unloadBinaryStream(tempFile, theRow.lobRowABlob.binaryStreamValue(), "BLOB");
    incRetrieveTime();
    }
  }
catch (Exception e)
  {
  throw new CSException("Error While downloading LOB Column A_BLOB: " + e.getMessage());
  }
 
try
  {
  // download BFILE associated with column A_BFILE
  if (filenameABfile != null && theRow.lobRowABfile != null)
    {
    java.io.File tempFile = new java.io.File (filenameABfile);
    
    theRow.filenameRowABfile = tempFile.getAbsolutePath();
    theRow.rowABfile = tempFile;
    startStatsTimer();
    theRow.rowABfile = objectLoader.unloadBfile(tempFile, theRow.lobRowABfile);
    incRetrieveTime();
    }
  }
catch (Exception e)
  {
  throw new CSException("Error While downloading LOB Column A_BFILE: " + e.getMessage());
  }
 
return(theRow);
}
